
import { useEffect, useRef, useState } from "react"
import { BouncyComp, RoseterComp, TabNavigator } from "../uiComps"
import { a, useSprings, config, useTransition } from '@react-spring/web'
import { colors } from "../constants/colors"
import useShowBottomSheet from "../hooks/useShowBottomSheet"
import useUserData from "../hooks/useUserData"
import RoasterComp from "../uiComps/RoasterComp"

const { mainHighlight, mainHighlig30 } = colors


export default function () {

    return <TabNavigator
        numberOfTabs={2}
        tabNames={["Sell", "Buy"]}
        renderTab={(i) => <RenderTabs index={i} />}
    />
}

const RenderTabs = ({ index }) => {

    if (index === 0) {
        return <Sell />
    }
    else
        return <Buy />
}

const Sell = () => {
    const myPlayers = [0, 1, 2, 3, 4]

    return <div className="f fc fh cardCont">
        {myPlayers.map(i => <RoseterComp key={i} />)}
    </div>

}

const Buy = () => {
    const playerData = useUserData();

    let show = useShowBottomSheet();

    const [players, setPlayers] = useState(JSON.parse(string))
    const teams = Object.keys(players);

    // setTimeout(() => {
    //     show(true);
    // }, 3000);

    // setTimeout(() => {
    //     show(false);
    // }, 6000);

    const myPlayers = [0, 1, 2, 3, 4]
    const [isIncreasingSort, setIsIncreasingSort] = useState(false)
    const [activeCategory, setActive] = useState(1);
    const categories = [
        {
            type: 'all',
            applyOperation: false, 
        },
        {
            type: 'Playing today',
            applyOperation: true,
            operation: arr => arr
        },
        {
            type: 'top Gainers',
            applyOperation: true,
            operation: arr => arr
        },
        {
            type: 'top Losers',
            applyOperation: true,
            operation: arr => arr
        }
    ]

    const styles = useSprings(categories.length, categories.map((_, i) => ({
        background: activeCategory === i ? mainHighlight : '#00000000',
        borderColor: activeCategory !== i ? mainHighlig30 : '#00000000',
        color: activeCategory === i ? '#fff' : mainHighlight,
        config: config.slow
    })))
    return <div className="f fc fh cardCont">
        <div
            className="f fw sortCont">
            <div style={{ overflow: 'scroll', gap: '4px' }} className="f">
                {categories.map((item, index) =>
                    <BouncyComp
                        key={index}
                        onClick={() => {
                            document.querySelector(`#${item.type.replace(/ /g, "")}`).scrollIntoView({ behavior: 'smooth', block: 'end' })
                            // console.log(document.querySelector(`#${item.type}`))
                            setActive(index)
                        }}
                        customChild={<a.h5
                            id={item.type.replace(/ /g, "")}
                            style={styles[index]}
                            className="sortingCategory">{item.type}</a.h5>}
                    />
                )
                }
            </div>

            <div onClick={() => setIsIncreasingSort(!isIncreasingSort)} className="f priceCont ac">
                Price
                <Arrow angle={isIncreasingSort ? 0 : 180} />
            </div>
        </div>

        {
            teams.map((team, i) => <RenderTeam index={i} isIncreasingSort={isIncreasingSort} teamName={team} teamData={players[team]} key={i} />)
        }
    </div>

}

const RenderTeam = ({ teamData, teamName, index, isIncreasingSort }) => {

    function shuffle(array) {
        let currentIndex = array.length,  randomIndex;
      
        // While there remain elements to shuffle...
        while (currentIndex != 0) {
      
          // Pick a remaining element...
          randomIndex = Math.floor(Math.random() * currentIndex);
          currentIndex--;
      
          // And swap it with the current element.
          [array[currentIndex], array[randomIndex]] = [
            array[randomIndex], array[currentIndex]];
        }
      
        return array;
      }

    const ref=useRef();
    let [x, set] = useState([teamData[0], teamData[1], teamData[2], teamData[3], teamData[4]])
    const [ih, setIh] = useState(null);

    // useEffect(()=>{
    //     setTimeout(() => {
    //         set([ teamData[0],teamData[5], teamData[6], teamData[1], teamData[2], teamData[3], teamData[4]])
    //     }, 5000);
    // }, [])

    useEffect(()=>{
        if(isIncreasingSort){
            set([...x.sort((a,b)=>a.price-b.price)])
        }
        else
            set([...x.sort((a,b)=>b.price-a.price)])
    }, [isIncreasingSort])

    // useEffect(()=>{
    //     if(index===0)
    //     setInterval(() => {
    //         set([...shuffle(x)])
    //     }, 3000);
    // }, [])

    let initialY = 0
    const transitions = useTransition(x.map((i, j) => ({
        y: j* ih, ...i, index: j
    })), {
        keys: (item) => item.id,
        from: {  opacity: 0 },
        leave: {  opacity: 0 },
        enter: ({ y }) => ({ y , opacity: 1 }),
        update: ({ y, index }) => ({ y }),
        config: config.default,
        delay: ({index})=>(x.length-index)*100
    })

    useEffect(() => {
        if(ih)
        ref.current.style.height = ih*teamData.length+'px'
    }, [setIh])


    if (ih)
        return <div ref={ref} className="rp f fc cardCont">
            <h3
                style={{
                    marginLeft: 'var(--baseVal5)',
                    fontWeight: 'bold'
                }}
            >{teamName}</h3>
            {
                transitions((style, item, t, i) => <RoasterComp
                price={item.price}
                styleFromProp={{ top: -(ih)*i, ...style, transitions: 'none'}}
                    name={item.name} />)
            }
        </div>
    else
        return <RoasterComp setIh={h => setIh(h+12)} />
}

const Arrow = ({ angle }) => {
    return <svg
        width={10}
        viewBox="0 0 14 13"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        style={{ transform: `rotate(${angle}deg)`, marginLeft: 'var(--baseVal2)', transition: 'all .3s' }}
    >
        <path
            d="M7.701 11.74a1 1 0 0 1-1.732 0L.2 1.75a1 1 0 0 1 .866-1.5h11.536a1 1 0 0 1 .866 1.5L7.7 11.74Z"
            fill="#fff"
        />
    </svg>

}


